# Commented out IPython magic to ensure Python compatibility.
import pandas as pd
import numpy as np
import matplotlib.pyplot as plt
# %matplotlib inline

df=pd.read_csv('/content/Reviews.csv')

"""## 2) Reading the Dataset"""

df.head()

print(df['Text'])

df.describe()

"""## 3) Separating Reviews and Scores(labels)"""

reviews=[x for x in df['Text']]
labels=[score for score in df['Score']]
final_labels=[]
for num in labels:
    if num>3:
        final_labels.append(1)
    else:
        final_labels.append(0)
        
print(reviews[1])
print(labels[1], end="\t")
print(final_labels[1])

final_labels=np.array(final_labels)
reviews=np.array(reviews)

"""## 4) Splitting the Data into Training and Testing"""

def split_data(X,Y,SPLIT_SIZE):
    split=int(len(X)*SPLIT_SIZE)
    training_sentences=X[:split]
    testing_sentences=X[split:]
    training_labels=Y[:split]
    testing_labels=Y[split:]
    return training_sentences,testing_sentences,training_labels,testing_labels

size=0.9
training_sentences,testing_sentences,training_labels,testing_labels=split_data(reviews,final_labels,size)

print(len(training_sentences))
print(len(testing_sentences))

training_sentences.shape

"""## 5) Creating a Corpus"""

vocab_size=10000
embedding_dim=16
max_length = 120
trunc_type='post'
oov_tok = "<OOV>"

from tensorflow.keras.preprocessing.text import Tokenizer
from tensorflow.keras.preprocessing.sequence import pad_sequences

tokenizer=Tokenizer(num_words=vocab_size, oov_token=oov_tok)
tokenizer.fit_on_texts(training_sentences)
word_index=tokenizer.word_index

training_sequences=tokenizer.texts_to_sequences(training_sentences)
testing_sequences=tokenizer.texts_to_sequences(testing_sentences)

training_padding = pad_sequences(training_sequences,maxlen=max_length, truncating=trunc_type, padding='post')
testing_padding = pad_sequences(testing_sequences,maxlen=max_length)

print(testing_sequences[0])
print(training_sequences[0])

print(training_padding[0])

"""## 5) Reversing the Word Index"""

reverse_word_index=dict([(y,x) for (x,y) in word_index.items()])
def decode_review(text):
    return ' '.join([reverse_word_index.get(i, '?') for i in text])

print(training_padding[3],end="\n\n")
print(decode_review(training_padding[3]))
print(training_sentences[3])

"""## 6) Creating a Deep RNN Neural Network"""

import tensorflow as tf
model = None
model = tf.keras.Sequential([
    tf.keras.layers.Embedding(vocab_size, embedding_dim, input_length=max_length),
    tf.keras.layers.LSTM(50),
    tf.keras.layers.Flatten(),
    tf.keras.layers.Dense(10, activation='relu'),
    tf.keras.layers.Dense(1, activation='sigmoid')
])
model.compile(loss='binary_crossentropy',optimizer='adam',metrics=['accuracy'])
model.summary()

"""## 7) Training the Model"""

num_epochs = 10
history=model.fit(training_padding, training_labels, epochs=num_epochs, validation_data=(testing_padding, testing_labels))

"""## 8) Sample Testing on the Model"""

def output(prediction):
  i=0
  prediction=prediction.reshape((-1,))
  map={1:'Good Review!', 0:'Bad Review!'}
  for x in prediction:
    if x > 0.5:
      prediction[i] = 1
    else:
      prediction[i] = 0
    i+=1
  s=[map.get(y) for y in prediction]
  print(s)

sentence=["I really liked that product, lovely stuff","The product was so bad!",
          "The product was below expectations","The goods were absolutely fantastic, marvelous!"]
sequence = tokenizer.texts_to_sequences(sentence)
padded=pad_sequences(sequence,padding='post',maxlen=max_length)
predict=model.predict(padded)
output(predict)